import{_ as a,a as o,b as r,c as d}from"./chunks/debug_swd_port_gnd_vcc3_3.Blkj46fH.js";import{_ as i,E as l,c as n,J as s,m as t,a as h,ab as c,o as u}from"./chunks/framework.CUflZczI.js";const v=JSON.parse('{"title":"Holybro Kakute F7 (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"en/flight_controller/kakutef7.md","filePath":"en/flight_controller/kakutef7.md"}'),p={name:"en/flight_controller/kakutef7.md"},m=t("h1",{id:"holybro-kakute-f7-discontinued",tabindex:"-1"},[h("Holybro Kakute F7 (Discontinued) "),t("a",{class:"header-anchor",href:"#holybro-kakute-f7-discontinued","aria-label":'Permalink to "Holybro Kakute F7 (Discontinued)"'},"​")],-1),f=c('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The <em>Kakute F7</em> from Holybro is a flight controller board designed for racers.</p><img src="'+a+'" width="400px" title="Kakute F7"><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="key-features" tabindex="-1">Key Features <a class="header-anchor" href="#key-features" aria-label="Permalink to &quot;Key Features&quot;">​</a></h2><ul><li>Main System-on-Chip: <a href="https://www.st.com/en/microcontrollers-microprocessors/stm32f745vg.html" target="_blank" rel="noreferrer">STM32F745VGT6</a><ul><li>CPU: 216 MHz ARM Cortex M7 with single-precision FPU</li><li>RAM: 320 KB SRAM</li><li>FLASH: 1 MB</li></ul></li><li>Standard racer form factor: 36x36 mm with standard 30.5 mm hole pattern</li><li>ICM20689 Accel / Gyro (Soft-mounted)</li><li>BMP280 Baro</li><li>microSD (for logging)</li><li>6 UARTs</li><li>1 I2C bus</li><li>6 PWM outputs</li><li>Built-in OSD chip (AB7456 via SPI)</li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p>The board can be bought from one of the following shops (for example):</p><ul><li><a href="https://www.getfpv.com/holybro-kakute-f7-tekko32-f3-metal-65a-4-in-1-esc-combo.html" target="_blank" rel="noreferrer">getfpv</a></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The <em>Kakute F7</em> is designed to work with the <em>Tekko32</em> 4-in-1 ESC and they can be bought in combination.</p></div><h2 id="connectors-and-pins" tabindex="-1">Connectors and Pins <a class="header-anchor" href="#connectors-and-pins" aria-label="Permalink to &quot;Connectors and Pins&quot;">​</a></h2><p>This is the silkscreen for the <em>Kakute F7</em>, showing the top of the board:</p><p><img src="'+o+'" alt="Kakute F7 Silkscreen"></p><table><thead><tr><th>Pin</th><th>Function</th><th>PX4 default</th></tr></thead><tbody><tr><td>B+</td><td>Battery positive voltage (2S-6S)</td><td></td></tr><tr><td>5V</td><td>5V output (2A max)</td><td></td></tr><tr><td>VO</td><td>Video output to video transmitter</td><td></td></tr><tr><td>VI</td><td>Video input from FPV camera</td><td></td></tr><tr><td>G or GND</td><td>Ground</td><td></td></tr><tr><td>SDA, SCL</td><td>I2C connection (for peripherals)</td><td></td></tr><tr><td>R1, T1</td><td>UART1 RX and TX</td><td>TELEM1</td></tr><tr><td>R2, T2</td><td>UART2 RX and TX</td><td>TELEM2</td></tr><tr><td>R3, T3</td><td>UART3 RX and TX</td><td>NuttX debug console</td></tr><tr><td>R4, T4</td><td>UART4 RX and TX</td><td>GPS1</td></tr><tr><td>R6, T6</td><td>UART6 RX and TX</td><td>RC port</td></tr><tr><td>R7, T7</td><td>UART7 RX and TX (RX is located in the plug for use with 4-in-1 ESCs)</td><td>DShot telemetry</td></tr><tr><td>LED</td><td>WS2182 addressable LED signal wire (not tested)</td><td></td></tr><tr><td>Buz-</td><td>Piezo buzzer negative leg (Connect buzzer positive leg to 5V pad)</td><td></td></tr><tr><td>3V3</td><td>3.3V output (200 mA max)</td><td></td></tr><tr><td>M1 to M4</td><td>Motor signal outputs (located in plug for use in 4-in-1 ESCs)</td><td></td></tr><tr><td>M5, M6</td><td>Additional motor signal outputs (located on side of board)</td><td></td></tr><tr><td>RSI</td><td>Analog RSSI (0-3.3V) input from receiver</td><td></td></tr><tr><td>Boot</td><td>Bootloader button</td><td></td></tr></tbody></table><p><a id="bootloader"></a></p><h2 id="px4-bootloader-update" tabindex="-1">PX4 Bootloader Update <a class="header-anchor" href="#px4-bootloader-update" aria-label="Permalink to &quot;PX4 Bootloader Update&quot;">​</a></h2><p>The board comes pre-installed with <a href="https://github.com/betaflight/betaflight/wiki" target="_blank" rel="noreferrer">Betaflight</a>. Before PX4 firmware can be installed, the <em>PX4 bootloader</em> must be flashed. Download the <a href="https://github.com/PX4/PX4-user_guide/raw/v1.15/assets/flight_controller/kakutef7/kakutef7_bl_0b3fbe2da0.hex" target="_blank" rel="noreferrer">kakutef7_bl.hex</a> bootloader binary and read <a href="./../advanced_config/bootloader_update_from_betaflight.html">this page</a> for flashing instructions.</p><h2 id="building-firmware" tabindex="-1">Building Firmware <a class="header-anchor" href="#building-firmware" aria-label="Permalink to &quot;Building Firmware&quot;">​</a></h2><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make holybro_kakutef7_default</span></span></code></pre></div><h2 id="installing-px4-firmware" tabindex="-1">Installing PX4 Firmware <a class="header-anchor" href="#installing-px4-firmware" aria-label="Permalink to &quot;Installing PX4 Firmware&quot;">​</a></h2><p>The firmware can be installed in any of the normal ways:</p><ul><li>Build and upload the source<div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make holybro_kakutef7_default upload</span></span></code></pre></div></li><li><a href="./../config/firmware.html">Load the firmware</a> using <em>QGroundControl</em>. You can use either pre-built firmware or your own custom firmware.</li></ul><h2 id="configuration" tabindex="-1">Configuration <a class="header-anchor" href="#configuration" aria-label="Permalink to &quot;Configuration&quot;">​</a></h2><p>If you use a 4-in-1 ESC with Betaflight/Cleanflight motor assignment you can use the <a href="./../config/actuators.html">Actuator</a> configuration UI to set the motor ordering appropriately.</p><p>In addition to the <a href="./../config/">basic configuration</a>, the following parameters are important:</p><table><thead><tr><th>Parameter</th><th>Setting</th></tr></thead><tbody><tr><td><a href="./../advanced_config/parameter_reference.html#SYS_HAS_MAG">SYS_HAS_MAG</a></td><td>This should be disabled since the board does not have an internal mag. You can enable it if you attach an external mag.</td></tr></tbody></table><h2 id="serial-port-mapping" tabindex="-1">Serial Port Mapping <a class="header-anchor" href="#serial-port-mapping" aria-label="Permalink to &quot;Serial Port Mapping&quot;">​</a></h2><table><thead><tr><th>UART</th><th>Device</th><th>Port</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td>TELEM1</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM2</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>Debug Console</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>RC SBUS</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>ESC telemetry (DShot)</td></tr></tbody></table><h2 id="debug-port" tabindex="-1">Debug Port <a class="header-anchor" href="#debug-port" aria-label="Permalink to &quot;Debug Port&quot;">​</a></h2><h3 id="system-console" tabindex="-1">System Console <a class="header-anchor" href="#system-console" aria-label="Permalink to &quot;System Console&quot;">​</a></h3><p>UART3 RX and TX are configured for use as the <a href="./../debug/system_console.html">System Console</a>.</p><h3 id="swd" tabindex="-1">SWD <a class="header-anchor" href="#swd" aria-label="Permalink to &quot;SWD&quot;">​</a></h3><p>The <a href="./../debug/swd_debug.html">SWD interface</a> (JTAG) pins are:</p><ul><li><code>SWCLK</code>: Test Point 2 (Pin 72 on the CPU)</li><li><code>SWDIO</code>: Test Point 3 (Pin 76 on CPU)</li><li><code>GND</code>: As marked on board</li><li><code>VDD_3V3</code>: As marked on board</li></ul><p>These are shown below.</p><p><img src="'+r+'" alt="SWD Pins on Kakute F7 - CLK SWO"> <img src="'+d+'" alt="SWD Pins on Kakute F7:  GND and VDD_3V3"></p>',37);function b(g,k,_,S,T,y){const e=l("Badge");return u(),n("div",null,[m,s(e,{type:"info",text:"Discontinued"}),f])}const A=i(p,[["render",b]]);export{v as __pageData,A as default};
